import React, { useState } from "react";
import Purchase from "../assets/icon/purchase.svg";
import Register from "../assets/icon/register.svg";
import { Link } from "react-router-dom";
import '../css/productIcon.css';

const ProductIcon = () => {
  return (
    <footer className="picon">
      <Link to='/ProductRegistration'>
        <li style={{ marginLeft: '23px' }}>
          <img className=" w-10 h-10" src={Purchase} alt="purchase" />
          <strong>등록</strong>
        </li>
      </Link>
      <div className="btn-product_registration">
        <a href="product_registration.html">
          <img src={Register} alt="register" width="50" height="50" />
        </a>
      </div>
    </footer >
  );
}

export default ProductIcon;
